Datasource.Parameter:
(select geometry, type
from osm_landusages_overlay
) as landusages

(SELECT geometry, type
 FROM osm_waterways
) as waterways

(SELECT geometry, type
FROM osm_waterways_gen9
) as waterways_gen9

(SELECT geometry, type
FROM osm_waterways_gen38
) as waterways_gen38

(SELECT geometry, type
FROM osm_waterways_gen150
) as waterways_gen150

(
    SELECT type as name, geometry from osm_housenumbers
) AS house_numbers
